");
   $m=$l;if($m>$maxranks)$m=$maxranks;
   for($i=0;$i<$m; $i++)
	{
	$r=$i+1;
   echo
   (
	 "   <tr>".
	 "<td>#<b>".$r."</b></td>".
	 "<td>".$highscore[$i][1]."</td>".
	 "<td>".$highscore[$i][0]."</td>".
	 "<td>".$highscore[$i][2]."</td>".
	 "<td>".$highscore[$i][3]."%</td>".
	 "<td>".date("d.M Y H:i",$highscore[$i][4])."</td>".
	 "</tr>\n"	 
   );
   } 
    echo("</table>\n");
}


